export default function() {
    return (
        <>
            <section className="chatContainer col">
                <div className="banner row-sm-2"></div>
                <ul className="row-sm-auto" id="messages"></ul>
                <div className="messageBox row-sm-2">
                    <form id="form" action="">
                    <input id="input" autoComplete="off" /><button>Send</button>
                    </form>
                </div>
            </section>
        </>
    )
}
